import styles from "./Css/AddUser.module.css";
function AddUser(params) {
  return (
    <div>
      <label className={styles.input.label}>User Name</label>
      <input type='text' className={styles.input.input} />
      <label className={styles.input.label}>User Age</label>
      <input type='number' className={styles.input.input} />
    </div>
  );
}
export default AddUser;
